func TestHeaderFromBytes(t *testing.T) {
	for _, parseTest := range parseTests {
		bs, _ := hex.DecodeString(parseTest.txByteStr)
		header, err := headerFromBytes(bs)
		if assert.Nil(t, err) {
			assert.Equal(t, &parseTest.header, header)
		}
	}
}

func TestSendMoneyTransacitonFromBytes(t *testing.T) {
	tx, err := SendMoneyTransactionFromBytes([]byte{})
	if assert.Nil(t, err) {
		assert.NotNil(t, tx)
	}
}
